import {createContext, useState} from 'react'
import './App.css'
import Header from './components/Header/Header'
import Dashboard from "./components/Dashboard/Dashboard"
import ControlBar from "./components/ControlBar/ControlBar"
import Table from "./components/Table/Table"
import SeparateBar from "./components/SeparateBar/SeparateBar"
import Detail from "./components/Detail/Detail"
import dummyData from '../dummyData/dummy'

function App() {
  const [info, setInfo] = useState(0)
  const [tableList, setTableList] = useState(dummyData)
  return (
    <div className="AppWrapper">
        <Header />
        <Dashboard />
        <ControlBar />
        <Table info={info} setInfo={setInfo} tableList={tableList} />
        <SeparateBar />
        <Detail info={info} tableList={tableList} setTableList={setTableList}/>
    </div>
  );
}

export default App;
